import React from "react";
import Data from "../data.json";

function Card() {
  console.log(Data);
  return (
    <div>
      {Data.map((item, key) => {
        return (
          <div key={key}>
            <img src={item.icon} alt={item.category} />
            <p>{item.category}</p>
            <p>{item.score}/100</p>
            <img src="../assets/images/icon-memory.svg" alt="jsjsj" />
          </div>
        );
      })}
    </div>
  );
}

export default Card;
